import React from 'react';
import {Text, View, StyleSheet, Button} from 'react-native';

const CounterScreen = () => {
    return (
        <View>
            <Text>Current Count:</Text>
        </View>
    )
}

const styles = StyleSheet.create({});

export default CounterScreen;
